import Comp2 from './Comp2'

function Comp1(props) {
    return (
        <div>
            <h1>Title : {props.title1} </h1>
            <p>{props.description1} </p> 

            <Comp2 title2 = 'title2'
            description2 = 'description2'/>       
        </div>        
    )
}

export default Comp1
